import Link from "next/link";

const PricingHero = () => (
  <div>
    <div className="hero">
      <div className="s-container">
        <h1>Pricing</h1>
        <p>
          Start building for free, only pay for what you use. Then add an Annual
          Enterprise plan for higher volume
          <br /> or require turnaround and quality SLAs.
        </p>
      </div>
      <div className="m-container">
        <div className="free-card">
          <h4>Try Scale API for free</h4>
          <p>No credit card required. No additional costs or termination fees.</p>
        </div>
      </div>
    </div>
    <style global jsx>{`
      .hero {
        color: white;
      }

      .free-card {
        color: black;
        height: 50vh;
        left: 85px;
        top: 305px;
        background: white;
        box-shadow: 5px 10px 10px rgba(0, 0, 0, 0.25);
        border-radius: 16px;
        padding: 10px 20px;
      }
    `}</style>
  </div>
);

export default PricingHero;
